import React from "react";
import "../../styles/footer";
import { FaGithub, FaLinkedin, FaTwitter } from "react-icons/fa";

const Footer = () => {
  return (
    <div className="footer">
      <div className="footer-content">
        <h2>Let's Connect!</h2>
        <p>Reach out via social media</p>
        <div className="icons">
          <a href="#"><FaGithub /></a>
          <a href="#"><FaLinkedin /></a>
          <a href="#"><FaTwitter /></a>
        </div>
      </div>
    </div>
  );
};

export default Footer;
